import gql from "graphql-tag";

export default gql`
  mutation($username: String!, $password: String!) {
    login(username: $username, password: $password) {
      token
      refreshToken
      user {
        id
        username
        employee {
          id
          firstnameThai
          lastnameThai
        }
      }
    }
  }
`;
